import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { toast } from "react-toastify";

const Register = () => {

    const [analyticsId, analyticsIdChange] = useState("");
    const [channelName, channelNameChange] = useState("");
    const [contentOwner, contentOwnerChange] = useState("");
    const [serviceId, serviceIdChange] = useState("");
    const [launchDate, launchDateChange] = useState("");
    const [country, countryChange] = useState("");
    const [originURL, originURLChange] = useState("");
    const [enableHarvestor, enableHarvestorChange] = useState(false);
    const [harvestorConfig, harvestorConfigChange] = useState("");
    const [hideOriginPath, hideOriginPathChange] = useState(false);
    const [enableOriginShield, enableOriginShieldChange] = useState(false);
    const [originShieldRegion, originShieldRegionChange] = useState("");
    const [ssaiRule, ssaiRuleChange] = useState("");
    const [coppa,coppaChange]=useState(false);
    const [epgStyle,epgStyleChange]=useState("");
    const [epgSourceURL,epgSourceURLChange]=useState("");
    const [state,stateChange]=useState("");
    const [authToken,authTokenChange]=useState("");
    


    const navigate = useNavigate();

    const IsValidate = () => {
        let isproceed = true;
        let errormessage = 'Please enter the value in';
    
        if (analyticsId === "") {
            isproceed = false;
            errormessage += ' Analytics ID';
        }
        if (channelName === "") {
            isproceed = false;
            errormessage += ' Channel Name';
        }
        if (contentOwner === "") {
            isproceed = false;
            errormessage += ' Content Owner';
        }
        if (serviceId === "") {
            isproceed = false;
            errormessage += ' Service ID';
        }
        if (launchDate === "") {
            isproceed = false;
            errormessage += ' Launch Date';
        }
        if (country === "") {
            isproceed = false;
            errormessage += ' Country';
        }
        if (originURL === "") {
            isproceed = false;
            errormessage += ' Origin URL';
        }
        if (!enableHarvestor) {
            isproceed = false;
            errormessage += ' Enable Harvestor ';
        }
        if (harvestorConfig === "") {
            isproceed = false;
            errormessage += ' Harvestor Config';
        }
        if (!hideOriginPath) {
            isproceed = false;
            errormessage += ' Hide Origin Path ';
        }
        if (!enableOriginShield) {
            isproceed = false;
            errormessage += ' Enable Origin Shield ';
        }
        if (originShieldRegion === "") {
            isproceed = false;
            errormessage += ' Origin Shield Region';
        }
        if (ssaiRule === "") {
            isproceed = false;
            errormessage += ' SSAI Rule';
        }
        if (!coppa) {
            isproceed = false;
            errormessage += ' Coppa ';
        }
        if (epgStyle === "") {
            isproceed = false;
            errormessage += ' EPG Info Style ';
        }
        if (epgSourceURL === "") {
            isproceed = false;
            errormessage += ' EPG Source URL ';
        }
        if (state === "") {
            isproceed = false;
            errormessage += ' State ';
        }
        if (authToken === "") {
            isproceed = false;
            errormessage += ' Auth Token';
        }
    
        if (!isproceed) {
            toast.warning(errormessage);
        }
        
        return isproceed;
    }
    


    const handlesubmit = (e) => {
            e.preventDefault();
            let regobj = { id, name, password, email, phone, country, address, gender };
            if (IsValidate()) {
            //console.log(regobj);
            fetch("http://localhost:8000/user", {
                method: "POST",
                headers: { 'content-type': 'application/json' },
                body: JSON.stringify(regobj)
            }).then((res) => {
                toast.success('Registered successfully.')
                navigate('/login');
            }).catch((err) => {
                toast.error('Failed :' + err.message);
            });
        }
    }
    return (
        <div>
            <div className="offset-lg-3 col-lg-6">
                <form className="container" onSubmit={handlesubmit}>
                    <div className="card">
                        <div className="card-header">
                            <h1>Channel Creation</h1>
                        </div>
                        <div className="card-body">

                            <div className="row">
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Analytics Id <span className="errmsg">*</span></label>
                                        <input value={analyticsId} onChange={e => analyticsIdChange(e.target.value)} className="form-control"></input>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Channel Name</label>
                                        <input value={channelName} onChange={e => channelNameChange(e.target.value)} className="form-control"></input>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Content Owner <span className="errmsg">*</span></label>
                                        <input value={contentOwner} onChange={e => contentOwnerChange(e.target.value)} className="form-control"></input>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Service Id <span className="errmsg">*</span></label>
                                        <input value={serviceId} onChange={e => serviceIdChange(e.target.value)} className="form-control"></input>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Launch Date <span className="errmsg"></span></label>
                                        <input value={launchDate} onChange={e => launchDateChange(e.target.value)} className="form-control"></input>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Country <span className="errmsg">*</span></label>
                                        <input value={country} onChange={e => countryChange(e.target.value)} className="form-control"></input>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Origin URL</label>
                                        <textarea value={originURL} onChange={e => originURLChange(e.target.value)} className="form-control"></textarea>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Enable Harvestor</label>
                                        <br></br>
                                        <input type="radio" checked={enableHarvestor} onChange={e => enableHarvestorChange(e.target.value)} name="enableHarvestor" value="true" className="app-check"></input>
                                        <label>True</label>
                                        <input type="radio" checked={!enableHarvestor} onChange={e => enableHarvestorChange(e.target.value)} name="enableHarvestor" value="false" className="app-check"></input>
                                        <label>False</label>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Harvestor Config</label>
                                        <textarea value={harvestorConfig} onChange={e => harvestorConfigChange(e.target.value)} className="form-control"></textarea>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Hide Origin Path</label>
                                        <br></br>
                                        <input type="radio" checked={hideOriginPath} onChange={e => hideOriginPathChange(e.target.value)} name="hideOriginPath" value="true" className="app-check"></input>
                                        <label>True</label>
                                        <input type="radio" checked={!hideOriginPath} onChange={e => hideOriginPathChange(e.target.value)} name="hideOriginPath" value="false" className="app-check"></input>
                                        <label>False</label>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Enable Origin Shield</label>
                                        <br></br>
                                        <input type="radio" checked={enableOriginShield} onChange={e => enableOriginShieldChange(e.target.value)} name="enableOriginShield" value="true" className="app-check"></input>
                                        <label>True</label>
                                        <input type="radio" checked={!enableOriginShield} onChange={e => enableOriginShieldChange(e.target.value)} name="enableOriginShield" value="false" className="app-check"></input>
                                        <label>False</label>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Origin Shield Region</label>
                                        <textarea value={originShieldRegion} onChange={e => originShieldRegionChange(e.target.value)} className="form-control"></textarea>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>SSAI Rule</label>
                                        <textarea value={ssaiRule} onChange={e => ssaiRuleChange(e.target.value)} className="form-control"></textarea>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>Coppa</label>
                                        <br></br>
                                        <input type="radio" checked={coppa} onChange={e => coppaChange(e.target.value)} name="coppa" value="true" className="app-check"></input>
                                        <label>True</label>
                                        <input type="radio" checked={!coppa} onChange={e => coppaChange(e.target.value)} name="coppa" value="false" className="app-check"></input>
                                        <label>False</label>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>EPG Style</label>
                                        <textarea value={epgStyle} onChange={e => epgStyleChange(e.target.value)} className="form-control"></textarea>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="form-group">
                                        <label>EPG Source URL</label>
                                        <textarea value={epgStyle} onChange={e => epgStyleChange(e.target.value)} className="form-control"></textarea>
                                    </div>
                                </div>
                                

                            </div>

                        </div>
                        <div className="card-footer">
                            <button type="submit" className="btn btn-primary">Register</button> |
                            <Link to={'/login'} className="btn btn-danger">Close</Link>
                        </div>
                    </div>
                </form>
            </div>


        </div>
    );
}

export default Register;
